script: |
  super -f text -I q11599.spq | sort > q11599.out

inputs:
  - name: q11599.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 - - 19 + + + col0 NOT IN ( - 97, - col0 * + col2 + 42, 68 * col2 );
  - name: tab1

outputs:
  - name: q11599.out
    data: |
      51	14	96
      85	5	59
      91	47	68
